import Footerr from "../Footer";
import NavBar from "../Navbar";

const FindTest = () => {
    return (
        <div> 
            <NavBar></NavBar>

            {/* Components  */}
            <nav>
                <div className="nav nav-tabs" id="nav-tab" role="tablist">
                <button Name="nav-link active" id="nav-home-tab" data-bs-toggle="tab" data-bs-target="#nav-home" type="button" role="tab" aria-controls="nav-home" aria-selected="true">Home</button>
                <button Name="nav-link" id="nav-profile-tab" data-bs-toggle="tab" data-bs-target="#nav-profile" type="button" role="tab" aria-controls="nav-profile" aria-selected="false">Profile</button>
                <button Name="nav-link" id="nav-contact-tab" data-bs-toggle="tab" data-bs-target="#nav-contact" type="button" role="tab" aria-controls="nav-contact" aria-selected="false">Contact</button>
                </div>
            </nav>
                <div Name="tab-content" id="nav-tabContent">
                <div Name="tab-pane fade show active" id="nav-home" role="tabpanel" aria-labelledby="nav-home-tab">...</div>
                <div Name="tab-pane fade" id="nav-profile" role="tabpanel" aria-labelledby="nav-profile-tab">...</div>
                <div Name="tab-pane fade" id="nav-contact" role="tabpanel" aria-labelledby="nav-contact-tab">...</div>
            </div>

            {/* Footer */}
            <Footerr></Footerr>
        </div>
     );
}
 
export default FindTest;
